import React from "react";
import {
  Box,
  Stack,
  TextField,
  Typography,
  Button,
  Link,
  useMediaQuery,
  useTheme,
} from "@mui/material";

const ForgetPassword = () => {
  const theme = useTheme();
  const isMdDown = useMediaQuery(theme.breakpoints.down("md"));
  const isSmDown = useMediaQuery(theme.breakpoints.down("sm"));

  return (
    <Box
      sx={{
        width: "100vw",
        height: "100vh",
        display: "flex",
        flexDirection: isMdDown ? "column" : "row-reverse",
        fontFamily: "Cairo, sans-serif",
        overflow: "hidden",
        alignItems: "center",
        justifyContent: isSmDown ? "flex-start" : "center",
        backgroundColor: "#f5f5f5",
        pt: isSmDown ? 4 : 0,
      }}
    >
      {/* الشق الأيسر بالصورة والخلفية */}
      {!isSmDown && (
        <Box
          sx={{
            width: isMdDown ? "90vw" : "704px",
            height: isMdDown ? "400px" : "880px",
            backgroundColor: "#317B74",
            borderRadius: "25px",
            position: "relative",
            overflow: "hidden",
            marginRight: isMdDown ? 0 : "32px",
          }}
        >
          {/* صورة الخلفية */}
          <Box
            sx={{
              position: "absolute",
              inset: 0,
              width: "100%",
              height: "100%",
              backgroundImage: "url('/images/labtob.png')",
              backgroundSize: "cover",
              backgroundPosition: "center",
              backgroundRepeat: "no-repeat",
              zIndex: 1,
            }}
          />
          {/* المنحنيات */}
          <img
            src="/images/Intersect.png"
            alt=""
            style={{
              position: "absolute",
              width: "426.62px",
              height: "426.93px",
              top: "-107px",
              left: "325px",
              opacity: 0.1,
              zIndex: 2,
            }}
          />
          <img
            src="/images/Union.png"
            alt=""
            style={{
              position: "absolute",
              width: "414.21px",
              height: "498.15px",
              bottom: 0,
              left: "217px",
              opacity: 0.1,
              zIndex: 2,
            }}
          />
          {/* النص الترحيبي */}
          <Box
            sx={{
              position: "absolute",
              top: "64px",
              left: "40px", // قلل القيمة لإزاحة العنوان أكثر لليمين
              width: "420px", // قلل العرض إذا أردت
              height: "120px", // قلل الارتفاع إذا أردت
              textAlign: "center",
              color: "#fff",
              zIndex: 3,
              display: "flex",
              flexDirection: "column",
              justifyContent: "center",
              alignItems: "center",
              opacity: 1,
            }}
          >
            <Typography
              fontSize="24px" // صغر الخط
              fontWeight={900}
              sx={{
                fontFamily: "Cairo",
                fontStyle: "normal",
                lineHeight: 1,
                letterSpacing: 0,
                textAlign: "center",
              }}
            >
              انطلق نحو النمو، مستقبلك يبدأ هنا
            </Typography>
            <Typography
              fontSize="24px" // صغر الخط
              fontWeight={900}
              mt={1}
              sx={{
                fontFamily: "Cairo",
                fontStyle: "normal",
                lineHeight: 1,
                letterSpacing: 0,
                textAlign: "center",
              }}
            >
              مع{" "}
              <Box component="span" sx={{ color: "#F9A825" }}>
                تدرّب
              </Box>
            </Typography>
          </Box>
        </Box>
      )}

      {/* الفورم */}
      <Box
        dir="rtl"
        sx={{
          width: isSmDown ? "100vw" : isMdDown ? "90vw" : "536px",
          px: isSmDown ? 2 : 0,
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          gap: 4,
        }}
      >
        {/* شعار + عنوان */}
        <Stack alignItems="center" spacing={1.5} mb={2}>
          <img
            src="/images/logo.png"
            alt="Tadrab Logo"
            style={{ width: "200px" }}
          />
          <Typography
            fontSize={isSmDown ? "22px" : "28px"}
            fontWeight={800}
            color="#000"
          >
            هل نسيت كلمة المرور؟
          </Typography>
          <Typography
            fontSize={isSmDown ? "14px" : "16px"}
            color="#777"
            fontWeight={400}
          >
            لا تقلق، سنرسل لك تعليمات إعادة التعيين
          </Typography>
        </Stack>

        {/* حقل البريد */}
        <Stack spacing={2} width="100%">
          <Stack spacing={1}>
            <Typography color="#000000cc">البريد الإلكتروني:</Typography>
            <TextField
              variant="outlined"
              placeholder="أدخل بريدك الإلكتروني هنا"
              fullWidth
              InputProps={{
                style: {
                  backgroundColor: "#ECF1F6",
                  borderRadius: "15px",
                  height: "48px",
                  fontFamily: "Cairo",
                  textAlign: "center",
                },
              }}
            />
          </Stack>
          <Button
            variant="contained"
            sx={{
              backgroundColor: "#317B74",
              borderRadius: "15px",
              height: "48px",
              fontWeight: 600,
              fontFamily: "Cairo",
              "&:hover": { backgroundColor: "#2d6e69" },
            }}
            fullWidth
          >
            إرسال
          </Button>
          <Typography align="center" fontSize="14px">
            هل تذكرت كلمة المرور؟ <Link href="#">تسجيل الدخول</Link>
          </Typography>
        </Stack>
      </Box>
    </Box>
  );
};

export default ForgetPassword;
